import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from "react-router-dom";
// Stylesheets, CSS files
import "./stylesheets/App.css";
import './stylesheets/Main.css';
import './stylesheets/Fonts.css';
import './stylesheets/Input.css';
import './stylesheets/Mobile.css';
import './stylesheets/Popup.css';
import './stylesheets/NavBar.css';
import './stylesheets/Margins.css';
import './stylesheets/Paddings.css';
import './stylesheets/Logotypes.css';
import './stylesheets/bunch/Bunch.css';
import './stylesheets/landings/genesis/Genesis.css';
import './stylesheets/landings/metinvest/NavBar.css';
import './stylesheets/landings/metinvest/Metinvest.css';
import './stylesheets/landings/metinvest/blocks/Game.css';
import './stylesheets/landings/metinvest/blocks/Book.css';
import './stylesheets/landings/metinvest/blocks/10Books.css';
import './stylesheets/landings/metinvest/blocks/SocialNetworks.css';
import './stylesheets/landings/metinvest/blocks/About.css';
import './stylesheets/landings/metinvest/blocks/Registration.css';
import './stylesheets/landings/metinvest/blocks/Articles.css';
import './stylesheets/landings/metinvest/blocks/Vacancies.css';
import './stylesheets/landings/metinvest/blocks/Greetings.css';
import './stylesheets/landings/bcf/BigCareerFest.css';
import './stylesheets/landings/bcf/blocks/Bunches.css';
import './stylesheets/landings/bcf/blocks/Metinvest.css';
import './stylesheets/landings/bcf/blocks/Olympiad.css';
import './stylesheets/landings/bcf/blocks/Greetings.css';
import './stylesheets/landings/bcf/blocks/Activities.css';
import './stylesheets/landings/bcf/blocks/Companies.css';
import './stylesheets/landings/bcf/blocks/Registration.css';
import './stylesheets/landings/bcf/blocks/Organizators.css';
import './stylesheets/landings/bcf/blocks/InfoPartners.css';
import './stylesheets/activities/Activities.css';
import './stylesheets/activities/Meta.css';
import './stylesheets/activities/VirtualStand.css';
// Fonts
import './fonts/proxima-nova/ProximaNova.css';
// Javascript application
import App from './javascript/App';

ReactDOM.render(
    <BrowserRouter>
        <App />
    </BrowserRouter>,
    document.getElementById("root")
);
